;; gorilla-repl.fileformat = 1

;; **
;;; # News Compounds Size
;;; 
;;; This worksheet drafts statistics, distribution and evolution of average.
;; **

;; @@
(ns thriving-forest
 (:require [gorilla-plot.core :as plot]
            [gorilla-repl.table :as table]
            [gg4clj.core :as gg4clj]
            [ceres-analytics.news-measures :refer [compound-size]]
            [ceres-analytics.helpers :refer [t0 tmax db element-color element-name broadcasters table-columns format-to-table-view]]
            [incanter.stats :as stats]
            [incanter.core :as incntr]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## Statistics
;; **

;; @@
(table/table-view 
  (map 
    (fn [[k v]] 
      (concat [(element-name k)] (format-to-table-view v))) 
    (zipmap (vals broadcasters) (map #(compound-size % t0 tmax :statistics) (keys broadcasters)))) 
  :columns table-columns)
