;; **
;;; ## Distribution
;; **

;; @@
(let [result (zipmap (vals broadcasters) (map (fn [id]  (compound-size id t0 tmax :distribution)) (keys broadcasters)))
       dat {:yvar (apply concat (vals result))
            :xvar (mapcat (fn [[k v]] (repeat (count v) (element-name k))) result)
            }]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :xvar :yvar] ]
         [:geom_boxplot]
    	 ;[:stat_summary {:fun.y :mean, :geom "point" :color "red" :size 2}]         
         [:scale_y_log10]
         [:guides {:fill "none"}]
         [:xlab "Broadcaster"]
         [:ylab "Average compound size"]
         [:theme_bw]
         [:ggtitle "Average compound size distribution"])]
      {:width 12 :height 6 })) 
;; @@

;; @@
(defn plot-size-dist [[id coll]]
(let [curr (compound-size id t0 tmax :distribution)
       dat {:xs (map first curr)
            :ys (map second curr)}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :xs :ys]]
         [:geom_bar {:stat "identity" :fill "#999999"}]
         [:xlab "Size"]
         [:ylab "Fraction"]
         [:theme_bw]
         [:ggtitle (str "Compound size distribution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;thriving-forest/plot-size-dist</span>","value":"#'thriving-forest/plot-size-dist"}
;; <=

;; @@
#_(for [b broadcasters]
  (plot-size-dist b))
;; @@

;; **
;;; ## Overall comparison
;; **

;; @@
(let [curr (map #(compound-size (key %) t0 tmax :fractions) broadcasters)
       dat {:values (concat (map :zero curr) (map :overall curr))
            :fraction (concat (repeat (count broadcasters) "Zero")
                              (repeat (count broadcasters) "Overall"))
           :bcs (vals broadcasters)}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes {:x :bcs :y :values :fill :fraction}]]
         [:geom_bar {:stat "identity" :colour "black" :position [:position_dodge]}]
         [:scale_fill_manual {:values [:c "#ffffff" "#222222"]}]
         [:xlab "Broadcaster"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle "Overall Message and Zero Response Count"])]
      {:width 12 :height 5}))
